export default (function(a,b,c,d,e,f,g){return {data:{"9EdY7FwJjp":{data:[{id:2745,attributes:{type:f,item_lang:{data:{id:3412,attributes:{title:"House of the Dragon",slug:"house-of-the-dragon"}}}}},{id:2747,attributes:{type:b,item_lang:{data:{id:3414,attributes:{title:"Bullet Train",slug:"bullet-train"}}}}},{id:2752,attributes:{type:b,item_lang:{data:{id:3419,attributes:{title:"White Noise",slug:"white-noise"}}}}},{id:2765,attributes:{type:b,item_lang:{data:{id:3432,attributes:{title:"Argylle",slug:"argylle"}}}}},{id:2772,attributes:{type:f,item_lang:{data:{id:3439,attributes:{title:"Super Pumped",slug:"super-pumped"}}}}}],meta:{pagination:{page:g,pageSize:25,pageCount:g,total:5}}},cv5l37rOly:{data:{id:180,attributes:{imdbId:"tt0072653",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BZTc5NDk1NDgtMThmYy00MWViLTk2ZjUtNTQyMDI1MDI0MDRjXkEyXkFqcGdeQXVyNzc5MjA3OA@@._V1_SX300.jpg",type:b,ratings:[{Source:"Internet Movie Database",Value:"6.4\u002F10"},{Source:"Rotten Tomatoes",Value:"56%"},{Source:"Metacritic",Value:"59\u002F100"}],item_lang:{data:{id:843,attributes:{title:d,plot:"Three orphaned siblings are forced upon confirmed bachelor Donovan (Bill Bixby) in a nineteenth century boom town of Quake City, California. After an earthquake shakes the area, the children find a large gold nugget worth tens of thousands of dollars. But their newfound wealth is causing more problems than it's solving, so they agree to \"give\" the gold to two bumbling outlaws (Tim Conway and Don Knott's). But they only way they can get the gold is to steal it from the bank vault where it's being held for safe keeping.",slug:"the-apple-dumpling-gang"}}},books:{data:[{id:2497,attributes:{title:d,description:a,thumbnail:a,authors:[e],firstBook:true,published:"1983-02-01",publisher:"Ace Books",subtitle:a}},{id:2498,attributes:{title:"Elements of Fiction Writing - Scene & Structure",description:"Craft your fiction with scene-by-scene flow, logic and readability. An imprisoned man receives an unexpected caller, after which \"everything changed...\" And the reader is hooked. But whether or not readers will stay on for the entire wild ride will depend on how well the writer structures the story, scene by scene. This book is your game plan for success. Using dozens of examples from his own work - including Dropshot,Tiebreaker and other popular novels - Jack M. Bickham will guide you in building a sturdy framework for your novel, whatever its form or length. You'll learn how to: • \"worry\" your readers into following your story to the end • prolong your main character's struggle while moving the story ahead • juggle cause and effect to serve your story action As you work on crafting compelling scenes that move the reader, moment by moment, toward the story's resolution, you'll see why... • believable fiction must make more sense than real life • every scene should end in disaster • some scenes should be condensed, and others built big Whatever your story, this book can help you arrive at a happy ending in the company of satisfied readers.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=LiFjDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:["Jack Bickham"],firstBook:c,published:"1999-03-15",publisher:"Penguin",subtitle:a}},{id:2499,attributes:{title:d,description:a,thumbnail:a,authors:["Jack Miles Bickham"],firstBook:c,published:"1975-01-01",publisher:a,subtitle:a}},{id:2500,attributes:{title:"The Excalibur Disaster",description:a,thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=GC-PNkRkezMC&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[e],firstBook:c,published:"1978-01-01",publisher:a,subtitle:a}},{id:2501,attributes:{title:"Setting",description:"Even if you have great characters, outstanding dialogue and a gripping plot, your story isn't complete without the appropriate setting. Setting is the unifying element in most fiction, working in concert with plot, characterization and point of view. Here you'll explore how to use setting as the basis for creating dramatic, engaging stories. Focusing on detail, language and observation, Jack Bickham's invaluable instruction will not only improve your ability to create a strong setting, but also enhance your writing skills as a whole. You'll learn:- the function of setting within the fiction writing process- how setting works with plot, characterization and point of view- the effect of setting on unity- ways to generate story ideas through setting- techniques for creating setting- how to use setting as a thematic device- methods for using setting to stimulate your reader's senses- how to incorporate factual information for texture and authenticity- exercises for improving your powers of observation- tips for recording ideas, events and descriptions using notebook entriesOver the course of his esteemed career, Jack Bickham published more than 80 novels and instructional books, including Writing Novels That Sell and the 38 Most Common Fiction Writing Mistakes (and How to Avoid Them). A former creative writing professor, he instructed thousands of writers through his classes, seminars and Writer's Digest magazine articles.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=kLwNKArfXBwC&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[e],firstBook:c,published:"1999-01-01",publisher:"Writers Digest Books",subtitle:a}}]}}},meta:{}}},prerenderedAt:1682568363054}}("","movie",null,"The Apple Dumpling Gang","Jack M. Bickham","series",1))